import React from 'react'
import styled from 'styled-components/native'

const AddItemArea = styled.View`
  background-color: #ccc;
  padding: 10px;
`

const AddItemInput = styled.TextInput`
  background-color: #fff;
  font-size: 15px;
  height: 50px;
  border-radius: 5px;
  color: #000;
`

export default () => {
  return (
    <AddItemArea>
      <AddItemInput />
    </AddItemArea>
  )
}
